import React from "react";
import { Link } from "react-router-dom";
import "./navbar.css";
import { useState } from "react";
import SignUp from "./signupPage.js";
import LogIn from "./loginPage.js";

const [openPopup, isOpen] = useState(false);

const Navbar = () => {
  return (
    <div>
      <nav className="header">
        <ul className="nav-left">
          <li>
            <Link to="/">
              <img src="/eventlylogo.svg" alt="evently logo" />
            </Link>
          </li>
          <li>
            <Link to="/home">Evently</Link>
          </li>
        </ul>
        <ul className="nav-right">
          <li>
            <Link onClick={ToggleFilters} to="/loginPage">
              Log In
            </Link>
          </li>
          <li>
            <Link onClick={ToggleFilters} to="/signupPage">
              Sign Up
            </Link>
          </li>
          <li>
            <Link to="/profile">
              <img src="/profilelogo.svg" alt="profile" />
            </Link>
          </li>
        </ul>
      </nav>
      <div>
        <SignUp trigger={openPopup}></SignUp>
        {/* <LogIn trigger={openPopup}></LogIn> */}
      </div>
    </div>
  );
};
const ToggleFilters = () => {
  var x = document.getElementById("");
  if (x.style.display === "none") {
    x.style.display = "block";
  } else {
    x.style.display = "none";
  }
};

export default Navbar;
